import React from 'react';
import "../styles/waveseparator.scss"

const WaveSeparator = (props : {videoFrameHeight : any}) => {
    return (
        <div className="wave-container">
            <svg viewBox="0 0 500 200" style={{top : props.videoFrameHeight * 0.9}}>
                <path d="M 0 50 C 150 -50 300 100 500 20 L 500 100 L 0 100" fill="#E0FFD8"></path>
                <path d="M 0 50 C 150 -50 330 130 500 50 L 500 100 L 0 100" fill="#A8E6CF" opacity="0.8"></path>
                <path d="M 0 50 C 215 -50 250 100 500 0 L 500 100 L 0 100" fill="#98FF98" opacity="0.5"></path>
            </svg>
        </div>
      )
  };
  
  export default WaveSeparator;
